import React from "react";

const SidebarRight = () => {
  return (
    <div className="h-screen bg-sidebar-rigth w-full flex flex-col text-12 animate-slide-left px">
      <div className="h-[70px] flex-none bg-gray-200 ">
        <div className="flex ">
          <span className="border rounded-2xl">Danh sách phát </span>
        </div>
      </div>
      <div className="">contend</div>

    </div>
  );
};

export default SidebarRight;
